import React from 'react'
import { Hero } from './Hero'

export const ParentHero = () => {
  return (
    <div>
        <Hero heroName={"batman"}/>
        <Hero heroName={"spiderman"}/>
        <Hero heroName={"ironman"}/>
        <Hero heroName={"joker"}/>
    </div>
  )
}
